INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1, 110501, 0.0, 4, "カオリ（サマー）", 24015, 0.0, "2019/07/31 12:00:00", 0.0, 4, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2, 110501, 4.0, 4, "カオリ（サマー）", 24016, 0.0, "2019/07/31 12:00:00", 0.0, 1, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("マジムンだらけで目が回るさ～！\nふらふらさ～！", 3, 110501, 0.0, 4, "カオリ（サマー）", 24017, 0.0, "2019/07/31 12:00:00", 0.0, 4, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4, 110501, 5.2, 1, "カオリ（サマー）", 24018, 0.0, "2019/07/31 12:00:00", 0.0, 2, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 110501, 4.2, 5, "カオリ（サマー）", 24019, 0.0, "2019/07/31 12:00:00", 0.0, 6, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6, 110501, 0.0, 2, "カオリ（サマー）", 24020, 0.0, "2019/07/31 12:00:00", 0.0, 2, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7, 110501, 6.4, 1, "カオリ（サマー）", 24021, 0.0, "2019/07/31 12:00:00", 0.0, 6, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8, 110501, 0.0, 2, "カオリ（サマー）", 24022, 0.0, "2019/07/31 12:00:00", 0.0, 2, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9, 110501, 10.08, 6, "カオリ（サマー）", 24023, 0.0, "2019/07/31 12:00:00", 0.0, 3, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10, 110501, 5.0, 1, "カオリ（サマー）", 24024, 0.0, "2019/07/31 12:00:00", 0.0, 2, 10021, "2030/12/17 14:59:59", 24);
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES ("私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11, 110501, 0.0, 2, "カオリ（サマー）", 24025, 0.0, "2019/07/31 12:00:00", 0.0, 2, 10021, "2030/12/17 14:59:59", 24);
